import React from "react";
import AffichageMot from "./AffichageMot";
import LettreErroner from "./LettreErroner";
import ChampTest from "./ChampTest";

const OnGoing = (props) => {
    const essai = (lettreEssayer) =>{
        console.log(lettreEssayer)
    }  
  return (
    <div>
        <h2>Il vous reste 7 chances</h2>
      <AffichageMot motCache={props.motCache}/>
      <LettreErroner/>
      <ChampTest essai={()=>essai(lettreEssayer)}/>
    </div>
  );
};

export default OnGoing;
